import{_ as e,o as r,c as o,O as i}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 18.2-146 Breaking, injuring, defacing, destroying, or preventing the operation of vehicle, aircraft, boat, or vessel; penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-146.md","filePath":"vacode/18.2-146.md"}'),a={name:"vacode/18.2-146.md"},t=i('<h1 id="§-18-2-146-breaking-injuring-defacing-destroying-or-preventing-the-operation-of-vehicle-aircraft-boat-or-vessel-penalties" tabindex="-1">§ 18.2-146 Breaking, injuring, defacing, destroying, or preventing the operation of vehicle, aircraft, boat, or vessel; penalties. <a class="header-anchor" href="#§-18-2-146-breaking-injuring-defacing-destroying-or-preventing-the-operation-of-vehicle-aircraft-boat-or-vessel-penalties" aria-label="Permalink to &quot;§ 18.2-146 Breaking, injuring, defacing, destroying, or preventing the operation of vehicle, aircraft, boat, or vessel; penalties.&quot;">​</a></h1><p>Any person who shall individually or in association with one or more others willfully break, injure, tamper with, or remove any part or parts of any vehicle, aircraft, boat, or vessel for the purpose of injuring, defacing, or destroying said vehicle, aircraft, boat, or vessel, or temporarily or permanently preventing its useful operation, or for any purpose against the will or without the consent of the owner of such vehicle, aircraft, boat, or vessel, or who shall in any other manner willfully or maliciously interfere with or prevent the running or operation of such vehicle, aircraft, boat, or vessel, is guilty of a Class 1 misdemeanor, unless such violation of this section involves the breaking, injuring, tampering with, or removal of a catalytic converter or the parts thereof, then he is guilty of a Class 6 felony. A prosecution or proceeding for a felony under this section is a bar to a prosecution or proceeding under § <a href="/vacode/18.2-137/">18.2-137</a> for the same act.</p><p>Code 1950, § 18.1-166; 1960, c. 358; 1975, cc. 14, 15; 2022, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0664" target="_blank" rel="noreferrer">664</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0665" target="_blank" rel="noreferrer">665</a>.</p>',3),n=[t];function s(l,c,h,f,p,g){return r(),o("div",null,n)}const u=e(a,[["render",s]]);export{d as __pageData,u as default};
